import React from "react";
import { SafeAreaViewBase, Text, View } from "react-native";

const HomeScreen = () => {
  return (
    <SafeAreaViewBase>
      <Text>Home</Text>
    </SafeAreaViewBase>
  );
};

export default HomeScreen;
